INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, "アメス", "2015/12/17 15:00:00", 0.0, 43005, 0, -416.5, 44, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 1, "2030/12/17 14:59:59", 1, 123001, 0, 0.0);
